<tr>
<td colspan=\"2\"><br /><span class=\"fontpoint\" style=\"color: #333333;\"><span class=\"fontpoint\" style=\"color: #333333;\">TOP Offshore Containers and Baskets Highlights:</span></span>
<ul>
<li>Available for Purchase or Rent</li>
<li>
<div>Available in either Expanded Metal, or Solid Metal, or a combination of both</div>
<div>&nbsp;</div>
</li>
<li>
<div>1\"x6\" thick solid Lift Post from top to bottom with pad eye utilized to ensure long term viability- in contrast to a pad eye welded to the top of a basket</div>
<ul>
<li>Pad Eye Lift Post is virtually indestructible.</li>
</ul>
</li>
<li>
<div>Lift Post tested to hold over 129,000 pounds</div>
<ul>
<li>One Lift Post can hold more than gross weight</li>
<li>A Solid 1\" x 6\" lift post will hold the weight of the entire basket and cargo.</li>
</ul>
</li>
<li><span>NO&nbsp;</span>Heat Affected Zone for pad eyes</li>
<li>All models load tested at 2.5:1 capacity and Non Destructive Inspected</li>
<li>Designed and tested to conform with British Standard EN 12079 (old 7072) and DNV CN 2.7-3 Portable Offshore Units (2006), DNV CN 2.7-1 Offshore Containers, and BP US, Shell, and BHP. (Does not ensure compliance with all parts of these standards)</li>
<li>Seal Welded with Flux-Core for maximum strength</li>
<li>Finishing Options: Painted or Galvanized</li>
<li>4\" lip prevents small objects from dropping out.</li>
<li>Forklift slots specially designed so they&nbsp;do not hold rocks that later fall out during transport</li>
<li>Solid floor or expanded metal grated floor available</li>
<li>Stackable</li>
<li>
<div>Standard Sizes:</div>
<ul>
<li>4\' x 8\' x 3\'</li>
<li>6\' x 12\' x 3\'</li>
<li>8\' x10\' x 3\'</li>
<li>6\' x 20\' x 3\'</li>
<li>8\' x 20\' x 3\'</li>
<li>8\' x 24\' x 3\'</li>
</ul>
</li>
<li>Custom Sizes Available. Will build to Suit.</li>
</ul>
