<td valign=\"middle\" width=\"100%\">
<p><span class=\"style58\">Revata Engineerings Cast Steel Thread Protectors with lifting bails / Lift Nubbins offer the best thread protection with excellent lifting capabilities to ensure safe handling of Tubular Products, Drill Collars, Drill Pipes, Downhole Toolings etc during manufacturing, shipping and on the rigs.<br /><br />The Cast Steel Thread Protectors with lifting bails / Lift Nubbins are manufactured from steel castings in accordance with A.S.T.M.S. No. A27 Grade 60-30 and B.S. 3100 Grade A1. The heavy-duty bails are suitable for picking up and laying down a drill collar with the catline.<br /><br />The Threads and shoulders of the Cast Steel Thread Protectors with lifting bails / Lift Nubbins are precision machined to the requirements set by the A.P.I. Standards.</span></p>
<p><span class=\"style58\"><br /><span class=\"style51\"><strong>Features and Benefits of the Cast Steel Thread Protectors with Lifting Bails / Lift Nubbins:</strong></span></span></p>
<p class=\"style58\"><img src=\"http://www.revataengineering.com/interface/arrowdots2.gif\" alt=\"Cast Steel Lifting Caps, Drill Pipe Protector Lifting Caps, Lift Nubbins\" width=\"10\" height=\"16\" align=\"absmiddle\" />&nbsp;We affix a Unique Serial Number on each Protector for complete traceability.</p>
<p class=\"style58\"><img src=\"http://www.revataengineering.com/interface/arrowdots2.gif\" alt=\"Cast Steel Lifting Caps, Drill Pipe Protector Lifting Caps, Lift Nubbins\" width=\"10\" height=\"16\" align=\"absmiddle\" />&nbsp;Each protector is load tested and certified and all necessary documents in this regard are provided.</p>
<p class=\"style58\">&nbsp;</p>
<p class=\"style58\"><span class=\"style58\">Each Cast Steel Thread Protector with lifting bail / Lift Nubbin has b</span>een load tested and inspected prior to sale. Due to the rough nature in which drill collars are handled, Revata Engineering recommends that the end users carry out frequent inspection to ensure that the bail is not cracked, threads are not damaged and that proper fitting to the connection is possible.</p>
<p class=\"style58\"><br /><strong><em>Note: Cast Steel Thread Protectors with lifting bail / Lift Nubbins should only be used to pick up or lay down one drill collar at the same time.</em></strong></p>
<p><strong><span class=\"style58\"><br />The standard Threads and Sizes available are as follows. However, we can also manufacture as per your specific requirements.</span></strong></p>
<p><span class=\"style49\"><span class=\"style41\"><br /><br /></span></span></p>
