INSERT INTO articles VALUES("4","img_201709140252211875733849","About Us","<p>Welcome to Specialised Lifting Services Limited. As the premier UK, Egypt and Ghana brand of lifting, hoisting and mechanical handling products, Specialised Lifting Services&nbsp;aim not only to offer a wide range of standard items, but also to create bespoke design manufactured products to complete the \"one stop shop\" facility, for all your lifting and moving needs, We also provides a safe, efficient and cost effective alternative to scaffolding and other conventional access methods. Operating extensively throughout the UK, Middle East and Africa, our industrial rope access expertise covers both the built and natural environments (geotechnical).</p>
